import { Grow } from "@material-ui/core";
import { Routes, Route } from "react-router-dom";
import Home from "./components/Home/Home";

import "./styles.css";
function App() {
  return (
    <Grow in>
      <main className="main">
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </main>
    </Grow>
  );
}

export default App;
